import React, { Component } from 'react'
import collaboratorIcon from '../svg_icons/collaborator.svg'
import { Dialog, DialogContent, DialogTitle, DialogActions, Divider } from '@material-ui/core';


export default class CollaboratorComponent extends Component {
    constructor(){
        super();
        this.state={
            Dopen:false
        }
    }




    handleDialog=()=>{
        this.setState({
            Dopen:true
        })
    }


    render() {
        return (
            <div>
                 <div><img onClick={this.handleDialog} src={collaboratorIcon} alt="collaboratorIcon" /></div>

                 <Dialog
                 open={this.state.Dopen}
                 className="dialogbox"
                 open={this.state.DialogOpen}
                 PaperProps={{
                     style: {
                         background: this.state.color,
                         width: "90%",
                         height: "auto"
                     }
                 }}

                 >
                     <DialogTitle>
                         <h5>Collaborators</h5>
                         <Divider/>
                     </DialogTitle>

                     <DialogContent>


                     </DialogContent>
                     <DialogActions>
                     <p>Cancel</p>
                        <p>Save</p>
                     </DialogActions>
                 </Dialog>
            </div>
        )
    }
}
